import './App.css';
import alphabets from './alphabets.js';
function App() {
  return (
    <div className="App">
      <div id="drum-machine">
        <div id="display">

        </div>
        <div></div>
        {alphabets.map((alphabets)=> <div className="drum-pad" id={alphabets.text}>
          {alphabets.text}
        </div>)}
      </div>
    </div>
  );
}

export default App;
